import React from 'react';
import './App.css';
import Header from "./Component/Header";
import Homepage from "./Component/Homepage";
import Footer from "./Component/Footer";



function App() {
  return (
    <div className="App">
  <Header></Header>
  <Homepage></Homepage>
  <Footer></Footer>
  </div>
  );
}

export default App;
